import { Link } from "react-router-dom/cjs/react-router-dom.min";

const Footer = () => {
    return ( 
        <div className="footer">
            <div className="box">
                <div className="Information">
                    <p>Information</p>
                    <a href="#">Home</a>
                    <Link to="/contact">Contact</Link>
                    <a href="#">About</a>
                </div>
            </div>
        </div>
     );
}

export default Footer;
